import React from "react";
import Moment from 'react-moment';
// import {} from 'react-icons/ai'


export const PostItem = ({ post }) => {
    if (!post) {
        return (
            <div>
                Завантаження...
            </div>
        )
    }

    return (
        <div>
            <div><Moment date={post.createdAt} format='D MMM YYYY'/></div>
            <div className="post-item">
                <h3>{post.model}</h3>
                <p>{post.urlOff}</p>
                <p>{post.urlBook}</p>
                <p>URL img</p>
                <p>{post.info}</p>
            </div>
        </div>

)}
